import React from 'react'
import Stack from '@mui/material/Stack';
import { Typography } from '@mui/material';
import LocationOnIcon from '@mui/icons-material/LocationOn';
import GitHubIcon from '@mui/icons-material/GitHub';
import LinkedInIcon from '@mui/icons-material/LinkedIn';
import Grid from '@mui/material/Grid';
import Box from '@mui/material/Box';
import PortfolioBox from './PortfolioBox';
import Userlogo from '../images/userlogo.png'
import Gamelogo from '../images/onetofifty.png'

const Rightcolumn = () => {
  return (
    <>
      <Box sx={{ flexGrow: 1,margin:"auto"}}>
        <Grid container spacing={4} padding="64px">
          <Grid item lg={4} md={4} sm={4} xs={4} >
            <Stack spacing={4}>
             <PortfolioBox url={"https://usermanagement-sjp.netlify.app/"} img={Userlogo} title={"Customer Management App"} description={"Quick and easy customer management"} tech={"React, Typescript, Node.js, MongoDB"}/>
             <PortfolioBox url={"https://gameonetofive.netlify.app/"} img={Gamelogo} title={"1-50 Game"} description={"A classic challenge to test your “reaction time”"} tech={"React, Javascript"}/>
             <PortfolioBox/>
            </Stack>


          </Grid>
          <Grid item lg={4} md={4} sm={4} xs={4}np>
            <Stack spacing={4}>
              <PortfolioBox/>
              <PortfolioBox/>
              <PortfolioBox/>
            </Stack>
          </Grid>
        </Grid>
      </Box>

    </>
  )
}

export default Rightcolumn
